import "./TaskItem.css";

const TaskItem = (props) => {
  return (
    <div className="task-container">
      <div className="task-item">
        <input type="checkbox" id={props.key.toString()} />
        <label for={props.key.toString()}>{props.todo}</label>
      </div>
    </div>
  );
};

export default TaskItem;
